  01> GORDON, Michael Charles
  b 06.09.1991
  Michael b. at Auckland.
  02> GORDON, Grace Margaret
  b 21.04.1994
  03>' WILLIAMS, Felicity Marian m on 14.07.1959 to GRIGG, Humphrey Gilbert
  b 30.10.1933
  b 06.05.1932
  Felicity b. at Gisborne and m. at Holy Trinity Church, Gisborne. Humphrey, s/o Gilbert Hutton Grigg and
  Margaret Rosamond Teschemaker, b. at Christchurch. Address: "Bodbrane", RD 3, Cheviot, North
  Canterbury.
  Felicity was educated at Woodford House and Auckland Business College. She has travelled overseas both
  before and after marriage and has been involved in a wide range of church and community activities. She
  is an Hon Life Member of the Cheviot Play Centre, President of the local Plunket Society (with long
  service medal), a member of Care Support Group and a Budget Advisor with the NZ Assn of Family
  Budgeting. Her interests include gardening, floral and fabric art, handcrafts, dressmaking, cooking and
  tennis.
  Humphrey was educated at Waihi Preparatory School and Christ's College and is a farmer at "Bodbrane".
  He is an Anglican Lay Reader and has served as Treasurer, People's Warden and Vestryman. He is active
  in the St John Ambulance Brigade and Association, the Cheviot A&P Association, Federated Farmers (one
  term as President) and School Committee (President). His interests include tennis and bowls, welding
  and metal crafts, woodturning and photography.
  Bodbrane
  Situated in North Canterbury on the south bank of the Hurunui River, two miles from the coast,
  "Bodbrane" comprises 300 ha. It is primarily a sheep breeding and fattening unit but also runs about
  100 head of cattle for fattening. It was purchased by Humphrey Gilbert Grigg in 1959 and, after their
  marriage, was farmed by Humphrey and Felicity Marian Grigg (nee Williams) until 1990 when management
  was taken over by their son, Peter Gilbert Kenneth Grigg.
  01> GRIGG, Belinda Margaret m on 28.05.1990 to STENFERT KROESE, Johannes
  Arie (Joost)
  b 15.03.1961
  b 04.11.1957
  Belinda b. at Cheviot and m. at Helmond. She is known by her maiden name. Joost, s/o Hendrik Adolf
  Stenfert Kroese and Suzanne Elisabeth van Holk, b, in the Netherlands.
  Belinda was educated at St Margaret's College. She has worked most of the time since then for
  advertising and marketing firms, including Time International in Holland. In 1990 she and Joost
  returned to New Zealand and are now living in Christchurch. Her interests include photography, the
  arts, vegetarian cooking and tennis.
  Joost works at the University of Canterbury as a computer technician.
